_","mc_valg","attachMovie","mc_valg_Array","push","a","aktiv","#132","num","#141","text","#49","valg_Array","_x","_y","#124","mc_sub_menu","#122","#123","ABC","#17","_visible","#135","charAt","onRelease","#83","p_num","#137","#88","#107","#94","toUpperCase","CliCKED SUB:",",","valgt","tint","bgr","com","#4","#22","to","#75","beskriv_Array","CliCKED HEADER","#130","#45","#131","#43","#12","#134","#21","#109","#127","Vold","Udadvendt","Indadvendt","AKTIVITET","Teokratisme","Inspireret lovgivning","Sekularisme","ISLAM I SAMFUNDET","Bogstavstro","Traditionalistisk","Symbolsk","SKRIFTSYN","Traditionens tolkning","Blandet tolkning","Nytolkning","TOLKNINGSGRUNDLAG","Minimalt engagement","Moderat engagement","Stærkt engagement","ENGAGEMENT","Array","Personen kan ty til vold i sit forsøg på at kæmpe for islam. Personen er typisk i opposition til det vestlige samfund og vil bekæmpe vestlig indflydelse.","Personen udtaler sig om islam i tv-debatter, kronikindlæg, hjemmesider eller tager på anden måde del i den offentlige diskussion om islam.","Personen er privat i sin tro og har ikke behov for at deltage i debatter eller på anden måde udfolde sin tro over for offentligheden.","Personen mener, at demokrati er shirk, idet demokratiet danner love, der strider imod islam. Istedet ønskes, at alle love skal baseres på sharia.","Personen mener, at lovgivningen skal inspireres af muslimsk tankesæt, eks. værdier i islam. Typisk en symbolsk nytolkning eller blandet tolkning.","Personen mener, at lovgivningen skal adskilles fra religionen. Sharia skal ikke spille en rolle for lovene.","Personen læser Koranen på en måde, så han forsøger at genetablere den forståelse af åbenbaringen, som Muhammed må have haft. Det betyder oftest, at tolkningen er mere bogstavstro.","Nogle muslimer mener, at den måde, man traditionelt har tolket Koranen og hadith’er på, stadig udgør en autoritet og er væsentlig at inddrage, når man møder nye udfordringer, som sharia skal give svar på. Traditionens tolkning er de klassiske lovskolers tolkninger.","Koranens læses kontekstuel, så tolkningen passer ind i det nutidige verdensbillede og samfund, som muslimen befinder sig i. Derfor bliver det ofte en symbolsk tolkning.","Lovskolernes tolkning af Koranen og Hadith står helt central for personen forståelse af, hvor man som muslim skal hente retningslinjerne for livsførelse.","Personen vælger den type tolkning, der passer til livsførelsen: Koranen og hadither kan nytolkes til at passe til noget mens lovskolernes tolkning anvendes, når de passer ind.","Personen mener, at Koranen og hadither skal nytolkes og vil ikke bruge lovskolernes traditionelle tolkning.Desuden foretages ofte en Individuel tolkning.","Personen er mere med i religionen af navn end af gavn. Religionen har minimal indflydelse på personen og dennes valg i livet (minimalisme).","Personen viser et delvist engagement i religionen. Religionen har kun en begrænset indflydelse på livet og den troende har måske et mere upersonligt forhold til religionen.","Personen viser et stærkt engagement i religionen, fx ved at sætte sig grundigt ind i religionen eller ved at lade religionen have stor indflydelse på deres liv (maksimalisme).","nogo_Array","c","gr_5c","gr_5b","gr_5a","gr_4c","gr_4b","gr_4a","gr_3c","gr_3b","gr_3a","gr_2c","gr_2b","gr_2a","gr_1c","gr_1b","gr_1a","runde","init"],"type":136},{"value":"init","type":305},{"body":[{"value":0,"type":305},{"index":2,"type":135},{"type":23},{"index":2,"type":303},{"value":5,"type":305},{"type":72},{"type":18},{"target":270,"type":157},{"index":0,"type":304},{"index":2,"type":303},{"index":1,"type":304},{"index":2,"type":303},{"type":71},{"index":2,"type":304},{"value":3,"type":305},{"index":1,"type":303},{"index":3,"type":304},{"type":82},{"type":29},{"index":0,"type":304},{"type":28},{"value":1,"type":305},{"index":4,"type":304},{"type":28},{"index":5,"type":304},{"type":82},{"type":23},{"index":6,"type":304},{"index":4,"type":304},{"type":28},{"type":29},{"index":6,"type":
